import React from 'react';

const PERIODS = ['2013/2014', '2014/2015', '2016/2017', '2017/2018', '2018/2019', '2019/2020', '2020/2021'];

const Periods = () => {
  const ListPeriods=PERIODS.map((p) => <option>{ p }</option>);
          
  return (<select >
            {ListPeriods}
          </select>);
}//Periods


export default Periods;
